import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { supabase } from '../supabaseClient';

const Navbar = ({ cartCount, openModal, user }) => {
  const navigate = useNavigate();

  return (
    <header style={{ boxShadow: '0 2px 5px rgba(0,0,0,0.1)' }}>
      {/* Top Main Bar: MegaMart Brand Blue */}
      <div style={topBarStyle}>
        <Link to="/" style={logoStyle}>
           <span style={logoBox}>M</span> MegaMart
        </Link>
        
        <div style={searchContainer}>
          <input type="text" placeholder="Search for electronics in Kigali..." style={searchInput} />
          <button style={searchButton}>Search</button>
        </div>

        <div style={navItems}>
          <Link to={user ? "/profile" : "/login"} style={linkItem}>
            <span style={smallText}>Hello, {user ? user.email.split('@')[0] : 'Sign In'}</span>
            <div style={boldText}>My Account</div>
          </Link>
          
          <div onClick={openModal} style={cartStyle}>
            <div style={cartIconWrapper}>
              <span>ðŸ›’</span>
              {cartCount > 0 && <span style={badgeStyle}>{cartCount}</span>}
            </div>
            <span style={boldText}>Cart</span>
          </div>
        </div>
      </div>

      {/* Secondary Sub-Bar: Clean Grey/White */}
      <div style={subBarStyle}>
        <span style={{ fontWeight: 'bold', color: '#008ECC' }}>â˜° All Categories</span>
        <span>Smartphones</span>
        <span>Laptops</span>
        <span>Accessories</span>
        <span>Flash Sales</span>
        <span style={{ marginLeft: 'auto', fontSize: '12px', opacity: 0.7 }}>Official Store in Rwanda</span>
      </div>
    </header>
  );
};

// --- Styles ---
const topBarStyle = { backgroundColor: '#ffffff', padding: '10px 50px', display: 'flex', alignItems: 'center', gap: '30px', borderBottom: '1px solid #eee' };
const logoBox = { backgroundColor: '#008ECC', color: 'white', padding: '5px 12px', borderRadius: '8px', marginRight: '5px' };
const logoStyle = { color: '#1a1a1a', textDecoration: 'none', fontSize: '22px', fontWeight: '900', display: 'flex', alignItems: 'center' };
const searchContainer = { flex: 1, display: 'flex', height: '42px', border: '2px solid #008ECC', borderRadius: '8px', overflow: 'hidden' };
const searchInput = { flex: 1, border: 'none', padding: '0 15px', outline: 'none', fontSize: '14px' };
const searchButton = { backgroundColor: '#008ECC', color: 'white', border: 'none', padding: '0 25px', cursor: 'pointer', fontWeight: 'bold' };
const navItems = { display: 'flex', gap: '25px', alignItems: 'center' };
const linkItem = { color: '#333', textDecoration: 'none', display: 'flex', flexDirection: 'column' };
const smallText = { fontSize: '11px', color: '#777' };
const boldText = { fontSize: '14px', fontWeight: 'bold' };
const cartStyle = { display: 'flex', alignItems: 'center', gap: '8px', cursor: 'pointer' };
const cartIconWrapper = { position: 'relative', fontSize: '22px' };
const badgeStyle = { position: 'absolute', top: '-8px', right: '-8px', backgroundColor: '#FF4D4D', color: 'white', fontSize: '10px', borderRadius: '50%', padding: '2px 6px' };
const subBarStyle = { backgroundColor: '#f8f9fa', padding: '8px 50px', display: 'flex', gap: '20px', fontSize: '13px', color: '#444', borderBottom: '1px solid #eee' };

export default Navbar;
